import Profile from './components/Profile';

const people = [
  { name: 'Geo', age: 18, hobby: ['Sports', 'Music'] },
  { name: 'John', age: 20, hobby: ['Music', 'Movie'] },
  { name: 'Mike', age: 22, hobby: ['Reading', 'dance'] },
];

const Example = () => {
  return (
    <>
      <ul>
        {people.map((person) => {
          <li key={person.name}>
            <Profile {...person} />
          </li>;
        })}
      </ul>
    </>
  );
};

export default Example;
